>\n<p>403というのは、エラーで何も表示されないってことですか？</p>\n<p>ダッシュボードのURLに/options.phpは表示されますか？<br />\n<pre><code>http://ワードプレスのURL/wp-admin/options.php</code></pre>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"nobita\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:30:\"\n			\n			\n			\n			\n			\n			\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"gobylover :  &quot;options.phpのみ403エラー&quot;\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://ja.forums.wordpress.org/topic/158231#post-225341\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Feb 2016 05:22:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"225341@https://ja.forums.wordpress.org/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:734:\"<p>nobitaさん</p>\n<p>詳しくありがとうございます。</p>\n<blockquote><p>options.phpに、postされたデータが送られているかどうかを、チェックしたり、どこで弾かれているのかをチェックしてみてはどうでしょうか？</p></blockquote>\n<p>具体的なやり方がわからずチェック出来ておりませんでした…</p>\n<p>ご提案頂いたとおりにoptions.phpを変更して『SAVE CHANGE』をしてみましたが、変わらず403となりました…</p>\n<p>403表示ページのURLは<br />\nドメイン/wp-admin/options.php</p>\n<p>テーマオプションのURLは<br />\nドメイン/wp-admin/themes.php?page=parabola-page</p>\n<p>となっています。\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"gobylover\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:30:\"\n			\n			\n			\n			\n			\n			\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"nobita :  &quot;Safariでスライダー画像が表示されない&quot;\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://ja.forums.wordpress.org/topic/158257#post-225340\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Feb 2016 05:16:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"225340@https://ja.forums.wordpress.org/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:832:\"<p>こんにちは、</p>\n<p>画像ファイル名に日本語をお使いのようですが、それを半角英数名に変更するとどうですか？</p>\n<p>偶数画像URLをsafariで開くと not found になりますが、その時のURLは</p>\n<pre><code>http://shimafuji.jp/wp-content/uploads/2016/02/メンタークラブ-1.png</code></pre>\n<p>chromeだと、<br />\n<pre><code>http://shimafuji.jp/wp-content/uploads/2016/02/%E3%83%A1%E3%83%B3%E3%82%BF%E3%83%BC%E3%82%AF%E3%83%A9%E3%83%95%E3%82%99-1.png</code></pre>\n<p>になります。</p>\n<p>chrome の　URLをsafariで開くと　正常に表示できます。</p>\n<p>なので、safariは、URLエンコード、URLデコードで何か違いそうなので、半角英数ファイル名でどうなるか、チェックしたほうがいいと思います。\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"nobita\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:30:\"\n			\n			\n			\n			\n			\n			\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"dct1050022 :  &quot;固定ページ閲覧制限パスワードについて&quot;\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://ja.forums.wordpress.org/topic/158259#post-225339\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Feb 2016 04:40:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"225339@https://ja.forums.wordpress.org/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:937:\"<p>いつも利用させて頂いております。</p>\n<p>WP初心者の為、お伺いさせて下さい。<br />\nご存知の方がいらっしゃいましたら、ご回答頂けると幸いです。</p>\n<p>現在、HP作成をしておりますが、固定ページの閲覧制限パスワードを設定したページを<br />\n作成中です。<br />\n先日までは、ページ表示→正確なパスワードを入力→ページ開かれる<br />\nとの正常の流れでしたが、<br />\n昨日、自動更新をされた際なのか、ページ表示→正確なパスワードを入力→ページが存在しない。<br />\nとなっており、またドメインアドレスもパスワード入力時と入力後で異なっておりました。</p>\n<p>こちら、修正操作ご存知の方教えて頂きたいです。<br />\n初歩的なことで申し訳ありませんが、宜しくお願い致します。\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"dct1050022\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:36:\"https://ja.forums.wordpress.org/rss/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:7:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Thu, 04 Feb 2016 07:46:17 GMT\";s:12:\"content-type\";s:23:\"text/xml; charset=UTF-8\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Thu, 04 Feb 2016 07:38:26 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";}s:5:\"build\";s:14:\"20160117043556\";}','no'),(21007,'_transient_timeout_feed_mod_498b4cc5a65f3557dea9a8cad8d4d322','1454615177','no'),(21008,'_transient_feed_mod_498b4cc5a65f3557dea9a8cad8d4d322','1454571977','no'),(21009,'_transient_timeout_dash_45827e8e892dd0b85803a110fad8690f','1454615177','no'),(21010,'_transient_dash_45827e8e892dd0b85803a110fad8690f','<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://ja.wordpress.org/2016/02/03/wordpress-4-4-2-security-and-maintenance-release/\'>WordPress 4.4.2 セキュリティとメンテナンスのリリース</a> <span class=\"rss-date\">2016.2.3</span><div class=\"rssSummary\">WordPress 4.4.2 が利用可能になりました。これは以前のすべてのバージョンに対するセキュリティリリ [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://ja.forums.wordpress.org/topic/158258#post-225373\'>Daisuke Akasaka :  &quot;消えた固定ページの復旧&quot;</a></li><li><a class=\'rsswidget\' href=\'https://ja.forums.wordpress.org/topic/158253#post-225372\'>gblsm :  &quot;てぃーだブログ(沖縄)のRSSがfetch_feedでエラーになる&quot;</a></li><li><a class=\'rsswidget\' href=\'https://ja.forums.wordpress.org/topic/158240#post-225371\'>hotman2zz :  &quot;投稿時のテーブル内文字入力（日本語）&quot;</a></li></ul></div>