'ジェル'),(13443,869,'回答','紫外線を当てると固くなるネイル用のウレタン樹脂のことをジェルといいます。ジェルの一番の特徴は、乾きの速さです。'),(13444,873,'_edit_last','1'),(13445,873,'回答','自爪に合わせて、アクリルで長 さを作っていくのですが、ネイルチップとの違いは自分の爪がベースなのでサイズがぴったり合って、ネイルが浮いたりしないことですね。\r\nまた、施術時間もスカルプチュアは２時間近くかかるので、すぐに装着出来てしまうネイルチップとはかなり違います。\r\nでも、その分強度が高いので、ネイルチップと違って、水仕事や力仕事をしても、折れたり取れたりすることが少ないです。\r\nスカルプチュアとネイルチップの違いというのは、細かい部分でほとんど違いますが、一番違うところは、爪の丈夫さではないでしょうか。'),(13446,873,'_edit_lock','1422026836:1'),(13447,878,'_edit_last','1'),(13448,878,'_edit_lock','1422088838:1'),(13449,878,'回答','フットの小指が小さい方や変形してしまっているお客様はたくさんいらっしゃいます。女性は窮屈な靴を履きますので、変形していないケースの方が珍しいくらいです。\r\nご心配なさらず、ご来店時にお気軽にネイリストにご相談いただければ幸いです。\r\nケアによってフットが美しくなり、健康なお爪を育てる意味でも有効ですので、是非ご利用下さいませ。\r\nさらにマニキュアやジェルで仕上げれば、見違えるようになり感動されるお客様も多くいらっしゃいます。\r\nお客様のご予約・ご来店をお待ちしております。'),(13450,880,'_edit_last','1'),(13451,880,'_edit_lock','1422088869:1'),(13452,880,'回答','気に入られたデザインが載っている雑誌をお持ちいただければ可能な限り、同じように仕上させていただきます。\r\nまた、ネイルアートなど全般に言えますが、「仕事柄あまり派手にできないけどそれなりに目 立つように」や「清楚な感じで」など、アバウトな要望でも結構ですので、ネイリストに気軽にご相談下さい。'),(13453,882,'_edit_last','1'),(13454,882,'_edit_lock','1422088908:1'),(13455,882,'回答','ジェ ルネイルは固まるときに熱を発します。通常は何も感じない程度ですが、爪の薄い方は熱く感じる場合もございます。\r\nその場合は一旦ライトから出していただいて構いません。担当スタッフにお伝え下さいませ。'),(13456,884,'_edit_last','1'),(13457,884,'_edit_lock','1422088938:1'),(13458,884,'回答','ジェルが剥げてくることを持ちというなら、個人差はあるものの約２週間から1ヶ月間です。ここでいう個人差とは、生活環境や、爪の状態の違いです。\r\n爪は伸びてくるので根元の隙間ができはじめます。爪に半分だけ色がついてるのっておかしいですよね？それが気になりだすのがだいたい３週間くらいです。\r\n生活環境や爪の状態を同じとするならば、正しい甘皮処理と下処理がしてあるかどうか、またそのテクニックで持ちは大きく違ってくるでしょう。\r\n自爪とジェルに隙間ができた場合はカビなどネイルトラブルの原因になりますのですぐにサロンへ行かれることをおすすめします。'),(13459,886,'_edit_last','1'),(13460,886,'_edit_lock','1422088961:1'),(13461,886,'回答','間違ったオフの方法で爪を傷めてしまう場合もありますので、特に初めての方はサロンでオフすることをお勧めいたします。\r\nどうしてもご事情によりご自宅でオフをされたい場合は、店頭にてジェルオフキットも販売しておりますので、お気軽にお問い合わせ下さい。'),(13462,888,'_edit_last','1'),(13463,888,'_edit_lock','1422089398:1'),(13464,888,'回答','爪切りは使わず、ネイル用のやすりで削りましょう。やすりを使うことでキレイな形をキープすることができます。\r\n伸びてきた爪を爪切りで切ると、衝撃でジェルと自爪の間に隙間ができ、そこから菌が入り繁殖する可能性もありますのでご注意下さい。'),(13465,890,'_edit_last','1'),(13466,890,'_edit_lock','1422089421:1'),(13467,890,'回答','ジェルの種類によっては、塗付前の下準備で爪に負担がかかるケースがあります。\r\n当店が導入しているジェルでは、爪の表面を粗く削るような下準備は不要ですので、それにより薄くなることはありません。'),(13468,892,'_edit_last','1'),(13469,892,'_edit_lock','1422089440:1'),(13470,892,'回答','まずは爪に負担をかけない生活を心がけましょう。人によってはですが、岩盤浴・プール・サウナなどで人工爪が浮きやすくなります。お手入れとしてはオイルを塗ったりするのも良いですね。'),(13471,894,'_edit_last','1'),(13472,894,'_edit_lock','1425984906:1'),(13473,894,'回答','３〜4週間に1回程度の付け替えであれば、ジェルネイルを続けてお楽しみ頂いても問題ないと考えています。\r\nジェルには様々な種類があり、下準備で爪を薄くしてしまうもの、酸が強く爪に負担を掛けてしまうもの、取り外しをする際に爪を傷めてしまうものなどがあります。したがって、ジェルをオフした時点で、爪の状態を見て判断する必要があります。'),(13474,896,'_edit_last','1'),(13475,896,'_edit_lock','1422089493:1'),(13476,896,'回答','カラー1色の場合で６０分程度が目安になると思います。\r\nアートをされる場合はデザインによってかかる時間が違いますので、アートが決まった時点で所要時間をお伝えしています。\r\nご予定のある方は「何時にはサロンを出たいよ！」とお伝えいただければ時間内にできるアートをご案内しますので遠慮なくおっしゃってくださいね。'),(13477,898,'_edit_last','1'),(13478,898,'_edit_lock','1422089509:1'),(13479,898,'回答','自分でムリに剥がしたり、短期間で取ったりつけたりしなければ傷むことはありません。'),(13480,900,'_edit_last','1'),(13481,900,'_edit_lock','1422089565:1'),(13482,900,'回答','思わず日常と同じことをされ る方が多いです。ボーリング時にはバンドエイドやテーピングを。ジュースの缶を開けるときにはオープナーやコインをご利用下さい。'),(13483,902,'_edit_last','1'),(13484,902,'_edit_lock','1451449085:1'),(13485,902,'回答','なるべくリペアをして付け替えの回数を減らすことによって、ある程度の期間は可能です。'),(13486,904,'_edit_last','1'),(13487,904,'_edit_lock','1422089612:1'),(13488,904,'回答','そのままお越しいただいて大丈夫です。\r\nお爪の長さに合った形やデザインをご提案致します。\r\nご要望により、お好きなお爪の長さや形に整えることも、ジェルで長さをお出しすることも可能です。\r\n一度ご相談下さい。'),(13489,906,'_edit_last','1'),(13490,906,'_edit_lock','1422089646:1'),(13491,906,'回答','まずはお電話でお気軽にご相談下さい。お爪の状態に合わせてコースをご提案させていただきます。必要があれば、リペア（修復）や長さ出しのメニューもご案内いたします。マニキュアやジェルネイルをして爪を意識することで噛み癖が治る方もいらっしゃいます。\r\n一度ご相談下さい。'),(13492,908,'_edit_last','1'),(13493,908,'_edit_lock','1422089678:1'),(13494,908,'回答','皮膚と同じ位の長さにして、スクエアで角を落とさないように施術いたします。是非、ご来店時にご相談いただけたらと思います。'),(13500,912,'_edit_last','1'),(13501,912,'_edit_lock','1452400425:1'),(13502,912,'_wp_page_template','page-templates/page-blog.php'),(13505,914,'_edit_last','1'),(