gs\";i:11;s:15:\"send-trackbacks\";}'),(35134,2206,'_edit_lock','1451449878:1'),(35135,2206,'rule','a:5:{s:5:\"param\";s:13:\"page_template\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:27:\"page-templates/page-faq.php\";s:8:\"order_no\";i:0;s:8:\"group_no\";i:0;}'),(35136,2207,'faq_0_メニュー名','ジェル'),(35137,2207,'_faq_0_メニュー名','field_56835bcbb609b'),(35138,2207,'faq_0_faq内容_0_question','爪は傷みませんか？'),(35139,2207,'_faq_0_faq内容_0_question','field_56835c09b609d'),(35140,2207,'faq_0_faq内容_0_answer','自分でムリに剥がしたり、短期間で取ったりつけたりしなければ傷むことはありません。'),(35141,2207,'_faq_0_faq内容_0_answer','field_56835c1cb609e'),(35142,2207,'faq_0_faq内容_1_question','時間はどれくらいかかりますか？'),(35143,2207,'_faq_0_faq内容_1_question','field_56835c09b609d'),(35144,2207,'faq_0_faq内容_1_answer','カラー1色の場合で６０分程度が目安になると思います。\r\nアートをされる場合はデザインによってかかる時間が違いますので、アートが決まった時点で所要時間をお伝えしています。\r\nご予定のある方は「何時にはサロンを出たいよ！」とお伝えいただければ時間内にできるアートをご案内しますので遠慮なくおっしゃってくださいね。'),(35145,2207,'_faq_0_faq内容_1_answer','field_56835c1cb609e'),(35146,2207,'faq_0_faq内容_2_question','ジェルを一度落としたら、１ヵ月以上空けなくてはいけないのですか？'),(35147,2207,'_faq_0_faq内容_2_question','field_56835c09b609d'),(35148,2207,'faq_0_faq内容_2_answer','３〜4週間に1回程度の付け替えであれば、ジェルネイルを続けてお楽しみ頂いても問題ないと考えています。\r\nジェルには様々な種類があり、下準備で爪を薄くしてしまうもの、酸が強く爪に負担を掛けてしまうもの、取り外しをする際に爪を傷めてしまうものなどがあります。したがって、ジェルをオフした時点で、爪の状態を見て判断する必要があります。'),(35149,2207,'_faq_0_faq内容_2_answer','field_56835c1cb609e'),(35150,2207,'faq_0_faq内容_3_question','浮きづらくするコツや、自分で出来るケア、普段の生活で気をつけることは何でしょうか？'),(35151,2207,'_faq_0_faq内容_3_question','field_56835c09b609d'),(35152,2207,'faq_0_faq内容_3_answer','まずは爪に負担をかけない生活を心がけましょう。人によってはですが、岩盤浴・プール・サウナなどで人工爪が浮きやすくなります。お手入れとしてはオイルを塗ったりするのも良いですね。'),(35153,2207,'_faq_0_faq内容_3_answer','field_56835c1cb609e'),(35154,2207,'faq_0_faq内容_4_question','ジェルネイルを続けると爪が薄くなるのですか？'),(35155,2207,'_faq_0_faq内容_4_question','field_56835c09b609d'),(35156,2207,'faq_0_faq内容_4_answer','ジェルの種類によっては、塗付前の下準備で爪に負担がかかるケースがあります。\r\n当店が導入しているジェルでは、爪の表面を粗く削るような下準備は不要ですので、それにより薄くなることはありません。'),(35157,2207,'_faq_0_faq内容_4_answer','field_56835c1cb609e'),(35158,2207,'faq_0_faq内容_5_question','伸びてきたら先端を爪切りで切っても大丈夫でしょうか？'),(35159,2207,'_faq_0_faq内容_5_question','field_56835c09b609d'),(35160,2207,'faq_0_faq内容_5_answer','爪切りは使わず、ネイル用のやすりで削りましょう。やすりを使うことでキレイな形をキープすることができます。\r\n伸びてきた爪を爪切りで切ると、衝撃でジェルと自爪の間に隙間ができ、そこから菌が入り繁殖する可能性もありますのでご注意下さい。'),(35161,2207,'_faq_0_faq内容_5_answer','field_56835c1cb609e'),(35162,2207,'faq_0_faq内容_6_question','ジェルネイルを自分でオフ（除去）することはできますか？'),(35163,2207,'_faq_0_faq内容_6_question','field_56835c09b609d'),(35164,2207,'faq_0_faq内容_6_answer','間違ったオフの方法で爪を傷めてしまう場合もありますので、特に初めての方はサロンでオフすることをお勧めいたします。\r\nどうしてもご事情によりご自宅でオフをされたい場合は、店頭にてジェルオフキットも販売しておりますので、お気軽にお問い合わせ下さい。'),(35165,2207,'_faq_0_faq内容_6_answer','field_56835c1cb609e'),(35166,2207,'faq_0_faq内容_7_question','ジェルネイルはどれくらいもちますか？'),(35167,2207,'_faq_0_faq内容_7_question','field_56835c09b609d'),(35168,2207,'faq_0_faq内容_7_answer','ジェルが剥げてくることを持ちというなら、個人差はあるものの約２週間から1ヶ月間です。ここでいう個人差とは、生活環境や、爪の状態の違いです。\r\n爪は伸びてくるので根元の隙間ができはじめます。爪に半分だけ色がついてるのっておかしいですよね？それが気になりだすのがだいたい３週間くらいです。\r\n生活環境や爪の状態を同じとするならば、正しい甘皮処理と下処理がしてあるかどうか、またそのテクニックで持ちは大きく違ってくるでしょう。\r\n自爪とジェルに隙間ができた場合はカビなどネイルトラブルの原因になりますのですぐにサロンへ行かれることをおすすめします。'),(35169,2207,'_faq_0_faq内容_7_answer','field_56835c1cb609e'),(35170,2207,'faq_0_faq内容_8_question','ジェルネイルは熱いって聞いたんですが？'),(35171,2207,'_faq_0_faq内容_8_question','field_56835c09b609d'),(35172,2207,'faq_0_faq内容_8_answer','ジェ ルネイルは固まるときに熱を発します。通常は何も感じない程度ですが、爪の薄い方は熱く感じる場合もございます。\r\nその場合は一旦ライトから出していただいて構いません。担当スタッフにお伝え下さいませ。'),(35173,2207,'_faq_0_faq内容_8_answer','field_56835c1cb609e'),(35174,2207,'faq_0_faq内容_9_question','ジェルってなんですか？'),(35175,2207,'_faq_0_faq内容_9_question','field_56835c09b609d'),(35176,2207,'faq_0_faq内容_9_answer','紫外線を当てると固くなるネイル用のウレタン樹脂のことをジェルといいます。ジェルの一番の特徴は、乾きの速さです。'),(35177,2207,'_faq_0_faq内容_9_answer','field_56835c1cb609e'),(35178,2207,'faq_0_faq内容','10'),(35179,2207,'_faq_0_faq内容','field_56835bf0b609c'),(35180,2207,'faq','1'),(35181,2207,'_faq','field_56835bbfb609a'),(35182,866,'faq_0_メニュー名','ジェル'),(35183,866,'_faq_0_メニュー名','