835c1cb609e'),(35258,2208,'faq_0_faq内容_7_question','ジェルネイルはどれくらいもちますか？'),(35259,2208,'_faq_0_faq内容_7_question','field_56835c09b609d'),(35260,2208,'faq_0_faq内容_7_answer','ジェルが剥げてくることを持ちというなら、個人差はあるものの約２週間から1ヶ月間です。ここでいう個人差とは、生活環境や、爪の状態の違いです。\r\n爪は伸びてくるので根元の隙間ができはじめます。爪に半分だけ色がついてるのっておかしいですよね？それが気になりだすのがだいたい３週間くらいです。\r\n生活環境や爪の状態を同じとするならば、正しい甘皮処理と下処理がしてあるかどうか、またそのテクニックで持ちは大きく違ってくるでしょう。\r\n自爪とジェルに隙間ができた場合はカビなどネイルトラブルの原因になりますのですぐにサロンへ行かれることをおすすめします。'),(35261,2208,'_faq_0_faq内容_7_answer','field_56835c1cb609e'),(35262,2208,'faq_0_faq内容_8_question','ジェルネイルは熱いって聞いたんですが？'),(35263,2208,'_faq_0_faq内容_8_question','field_56835c09b609d'),(35264,2208,'faq_0_faq内容_8_answer','ジェ ルネイルは固まるときに熱を発します。通常は何も感じない程度ですが、爪の薄い方は熱く感じる場合もございます。\r\nその場合は一旦ライトから出していただいて構いません。担当スタッフにお伝え下さいませ。'),(35265,2208,'_faq_0_faq内容_8_answer','field_56835c1cb609e'),(35266,2208,'faq_0_faq内容_9_question','ジェルってなんですか？'),(35267,2208,'_faq_0_faq内容_9_question','field_56835c09b609d'),(35268,2208,'faq_0_faq内容_9_answer','紫外線を当てると固くなるネイル用のウレタン樹脂のことをジェルといいます。ジェルの一番の特徴は、乾きの速さです。'),(35269,2208,'_faq_0_faq内容_9_answer','field_56835c1cb609e'),(35270,2208,'faq_0_faq内容','10'),(35271,2208,'_faq_0_faq内容','field_56835bf0b609c'),(35272,2208,'faq_1_メニュー名','スカルプチュア'),(35273,2208,'_faq_1_メニュー名','field_56835bcbb609b'),(35274,2208,'faq_1_faq内容_0_question','ずっと人工爪を着けていても平気ですか？'),(35275,2208,'_faq_1_faq内容_0_question','field_56835c09b609d'),(35276,2208,'faq_1_faq内容_0_answer','なるべくリペアをして付け替えの回数を減らすことによって、ある程度の期間は可能です。'),(35277,2208,'_faq_1_faq内容_0_answer','field_56835c1cb609e'),(35278,2208,'faq_1_faq内容_1_question','人工爪を付けているとき、やってはいけないことや、出来ないことはなんですか？'),(35279,2208,'_faq_1_faq内容_1_question','field_56835c09b609d'),(35280,2208,'faq_1_faq内容_1_answer','思わず日常と同じことをされ る方が多いです。ボーリング時にはバンドエイドやテーピングを。ジュースの缶を開けるときにはオープナーやコインをご利用下さい。'),(35281,2208,'_faq_1_faq内容_1_answer','field_56835c1cb609e'),(35282,2208,'faq_1_faq内容_2_question','スカルプチュアってなんですか？'),(35283,2208,'_faq_1_faq内容_2_question','field_56835c09b609d'),(35284,2208,'faq_1_faq内容_2_answer','自爪に合わせて、アクリルで長 さを作っていくのですが、ネイルチップとの違いは自分の爪がベースなのでサイズがぴったり合って、ネイルが浮いたりしないことですね。\r\nまた、施術時間もスカルプチュアは２時間近くかかるので、すぐに装着出来てしまうネイルチップとはかなり違います。\r\nでも、その分強度が高いので、ネイルチップと違って、水仕事や力仕事をしても、折れたり取れたりすることが少ないです。\r\nスカルプチュアとネイルチップの違いというのは、細かい部分でほとんど違いますが、一番違うところは、爪の丈夫さではないでしょうか。'),(35285,2208,'_faq_1_faq内容_2_answer','field_56835c1cb609e'),(35286,2208,'faq_1_faq内容','3'),(35287,2208,'_faq_1_faq内容','field_56835bf0b609c'),(35288,2208,'faq_2_メニュー名','アート'),(35289,2208,'_faq_2_メニュー名','field_56835bcbb609b'),(35290,2208,'faq_2_faq内容_0_question','雑誌に載っているデザインで気に入っているネイルアートがあります。同じようなものをしていただく事はできますか？'),(35291,2208,'_faq_2_faq内容_0_question','field_56835c09b609d'),(35292,2208,'faq_2_faq内容_0_answer','気に入られたデザインが載っている雑誌をお持ちいただければ可能な限り、同じように仕上させていただきます。\r\nまた、ネイルアートなど全般に言えますが、「仕事柄あまり派手にできないけどそれなりに目 立つように」や「清楚な感じで」など、アバウトな要望でも結構ですので、ネイリストに気軽にご相談下さい。'),(35293,2208,'_faq_2_faq内容_0_answer','field_56835c1cb609e'),(35294,2208,'faq_2_faq内容','1'),(35295,2208,'_faq_2_faq内容','field_56835bf0b609c'),(35296,2208,'faq_3_メニュー名','その他'),(35297,2208,'_faq_3_メニュー名','field_56835bcbb609b'),(35298,2208,'faq_3_faq内容_0_question','巻き爪はどうしたら痛くないのですか？'),(35299,2208,'_faq_3_faq内容_0_question','field_56835c09b609d'),(35300,2208,'faq_3_faq内容_0_answer','皮膚と同じ位の長さにして、スクエアで角を落とさないように施術いたします。是非、ご来店時にご相談いただけたらと思います。'),(35301,2208,'_faq_3_faq内容_0_answer','field_56835c1cb609e'),(35302,2208,'faq_3_faq内容_1_question','爪をかむ癖があり、深爪です。それでも大丈夫でしょうか？'),(35303,2208,'_faq_3_faq内容_1_question','field_56835c09b609d'),(35304,2208,'faq_3_faq内容_1_answer','まずはお電話でお気軽にご相談下さい。お爪の状態に合わせてコースをご提案させていただきます。必要があれば、リペア（修復）や長さ出しのメニューもご案内いたします。マニキュアやジェルネイルをして爪を意識することで噛み癖が治る方もいらっしゃいます。\r\n一度ご相談下さい。'),(35305,2208,'_faq_3_faq内容_1_answer','field_56835c1cb609e'),(35306,2208,'faq_3_faq内容_2_question','短い爪は伸びるまでサロンに行くのを待ったほうがよいでしょうか？'),(35307,2208,'_faq_3_faq内容_2_question','field_56835c09b609d'),(35308,2208,'faq_3_faq内容_2_answer','そのままお越しいただいて大丈夫です。\r\nお爪の長さに合った形やデザインをご提案致します。\r\nご要望により、お好きなお爪の長さや形に整えることも、ジェルで長さをお出しすることも可能です。\r\n一度ご相談下さい。'),(35309,2208,'_faq_3_faq内容_2_answer','field_56835c1cb609e'),(35310,2208,'faq_3_faq内容_3_question','フットネイルをしたいのですが、足の指がとても小さく、お願いできるか心配です。'),(35311,2208,'_faq_3_faq内容_3_question','field_56835c09b609d'),(35312,2208,'faq_3_faq内容_3_answer','フットの小指が小さい方や変形してしまっているお客様はたくさんいらっしゃいます。女性は窮屈な靴を履きますので、変形していないケースの方が珍しいくらいです。\r\nご心配なさらず、ご来店時にお気軽にネイリストにご相談いただければ幸いです。\r\nケアによってフットが美しくなり、健康なお爪を育てる意味でも有効ですので、是非ご利用下さいませ。\r\nさらにマニキュアやジェルで仕上げれば、見違えるようになり感動されるお客様も多くいらっしゃいます。\r\nお客様のご予約・ご来店をお待ちしております。'),(35313,2208,'_faq_3_faq内容_3_answer','field_56835c1cb609e'),(35314,2208,'faq_3_faq内容','4'),(35315,2208,'_faq_3_faq内容','field_56835bf0b609c'),(35316,2208,'faq','4'),(35317,2208,'_faq','field_56835bbfb609a'),(35318,866,'faq_1_メニュー名','スカルプチュア'),(35319,866,'_faq_1_メニュー名','field_56835bcbb609b'),(35320,866,'faq_1_faq内容_0_question','ずっと人工爪を着けていても平気ですか？'),(35321,866,'_faq_1_faq内容_0_question','field_56835c09b609d'),(35322,866,'faq_1_faq内容_0_answer','なるべくリペアをして付け替えの回数を減らすことによって、ある程度の期間は可能です。'),(35323,866,'_faq_1_faq内容_0_answer','field_56835c1cb609e'),(35324,866,'faq_1_faq内容_1_question','人工爪を付けているとき、やってはいけないことや、出来ないことはなんですか？'),(35325,866,'_faq_1_faq内容_1_question','field_56835c09b609d'),(35326,866,'faq_1_faq内容_1_answer','思わず日常と同じことをされ る方が多いです。ボーリング時にはバンドエイドやテーピングを。ジュースの缶を開けるときにはオープナーやコインをご利用下さい。'),(35327,866,'_faq_1_faq内容_1_answer','field_56835c1cb609e'),(35328,866,'faq_1_faq内容_2_question','スカルプチュアってなんですか？'),(35329,866,'_faq_1_faq内容_2_question','field_56835c09b609d'),(35330,866,'faq_1_faq内容_2_answer','自爪に合わせて、アクリルで長 さを作っていくのですが、ネイルチップとの違いは自分の爪がベースなのでサイズがぴったり合って、ネイルが浮いたりしないことですね。\r\nまた、施術時間もスカルプチュアは２時間近くかかるので、すぐに装着出来てしまうネイルチップとはかなり違います。\r\nでも、その分強度が高いので、ネイルチップと違って、水仕事や力仕事をしても、折れたり取れたりすることが少ないです。\r\nスカルプチュアとネイルチップの違いというのは、細かい部分でほとんど違いますが、一番違うところは、爪の丈夫さではないでしょうか。'),(35331,866,'_faq_1_faq内容_2_answer','field_56835c1cb609e'),(35332,866,'faq_1_faq内容','3'),(35333,866,'_faq_1_faq内容','field_56835bf0b609c'),(35334,866,'faq_2_メニュー名','アート'),(35335,866,'_faq_2_メニュー名','field_56835bcbb609b'),(35336,866,'faq_2_faq内容_0_question','雑誌に載っているデザインで気に入っているネイルアートがあ